import React from "react";
const query = "Mekdes1";
class UsersLoding extends React.Component {
  componentDidMount() {
    fetch(`https://api.github.com/search/users?q=${query}`)
      .then((data) => data.json())
      .then((response) => console.log(response.item));
  }

  render() {
    return <h1>working</h1>;
  }
}

export default UsersLoding;
